import React from 'react'

export const Card = () => {


    const Api = async() => {

        const url = 'https://api.gael.cl/general/public/sismos';
        const resp = await fetch( url );
        const data = await resp.json();

        console.log(data)
    }
    Api();

    return (
        <>
           <h1>{ data[2] }</h1>
        </>
    )
}
